import ZJSBridge from "./index";

if (!window.ZJSBridge) {
    window.ZJSBridge = {};
}

window.ZJSBridge = ZJSBridge;
window.zaloJSV2 = {
    zalo_h5_event_handler: function (eventId, eventName, eventData) {
        ZJSBridge.nativeEventHandler(eventId, eventName, eventData);
    },
};

export default ZJSBridge;
